  input: '"TEXT","F3XA","","In response to the RFAI dated June 22, 2005, the Credit
    Union Legislative Action Committee of CUNA (CULAC) is amending this 2005 April
    Monthly FEC Report and subsequent reports so that the questions raised in the
    RFAI are answered.  In short, the description of the disbursement to MPI Coin
    has been changed to read Coins for PAC Fundraising Program.  CULAC also is amending
    its Statement of Organization to list the Colorado Credit Union League PAC as
    an affiliated committee.  In addition, funds received from the Colorado Credit
    Union League PAC, a collecting agent, were from unitemized individual contributions
    to CULAC, rather than a transfer.  Accordingly, this amendment reflects the changed
    status of receipts."'
